// Logout.js
import React from 'react';
import { useAuth } from '../AuthContext';

const Logout = () => {
  const { logout } = useAuth();

  const handleLogoutClick = () => {
    logout();
  };

  return (
    <div className="logout-container">
      <button onClick={handleLogoutClick}>Logout</button>
    </div>
  );
};

export default Logout;
